import React, { Component } from 'react';
import "./About.css";
import myIMG from "../assets/myIMG.jpg";

export default class About extends Component {
  render() {
    return (
      <div>
          <img 
          className="profile_image"
          scr = {myIMG}
          // Image goes here
          alt="Profile Pic"
          ></img>

        <p>Design your about me page </p>
      </div>      
    )
  }
}
